import React from 'react';
import Header from './Header/Header';
import Banner from './Banner/Banner';
import Home from './Home/Home';
import Gallery from './Gallery/Gallery';
import Testimonials from './Testimonials/Testimonials';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Banner />
      <Home />
      <Gallery />
      <Testimonials />
      <Footer />
    </div>
  );
}

export default App;
